import React from 'react';
// import { neonCursor } from 'threejs-toys';
import './App.css';
import Footer from './Components/Footer';
// import Home from './pages/Home';
import Navbar from './Components/Navbar';
import Neoncursor from './Components/Neoncursor';


function App() {

  const pStyle = {
    position: 'absolute',
    // top: '18%',
    left: '45%',
    textAlign: 'center',
    lineHeight: '80px',
    margin: 'calc(50vh - 80px) auto 0',
    fontSize: '60px',
    textTransform: 'uppercase',
    color: 'white',
    // zIndex: '1000',
    pointerEvents: 'none',
    position: 'absolute',
width: '621px',
height: '485px',
left: '444px',
top: '4px',

fontFamily: 'Poppins',
fontStyle: 'normal',
fontWeight: '300',
fontSize: '96px',
lineHeight: '120%',
/* or 115px */

display: 'flex',
alignItems: 'center',

color: '#FF4700',
  }

  return (
    <div className="App">
        <Navbar />
        <Neoncursor />
        <p style={pStyle}>light defines
spatial experience
as it falls and reflects</p>
        <Footer />
    </div>
  );
}

export default App;
